CREATE TABLE [wrestling.wrestlers] (
    [Wrestler ID]	INT,
    [Ring Name]	VARCHAR(512),
    [Name]	VARCHAR(512),
    [Champion]	VARCHAR(512),
    [Team ID]	VARCHAR(512),
    [Tag Team]	VARCHAR(512),
    [Gender]	VARCHAR(512),
    [PromoID]	INT,
    [Promotion]	VARCHAR(512),
    [ShowID]	INT,
    [Show]	VARCHAR(512)
);

